<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title>Elaborate</title>
    <link rel="stylesheet" href="/bundle.css" media="all">
    <style>
      html, body, .container, #app {
        height: 100%;
        width: 100%;
        margin: 0;
        padding: 0;
      }
      .d2h-wrapper { text-align: left; padding: 0 32px; }
      .d2h-file-header { display: none; }
      .d2h-file-stats { display: flex; margin-left: auto; font-size: 14px; }
      .d2h-lines-added { text-align: right; border: 1px solid #b4e2b4; border-radius: 5px 0 0 5px; color: #399839; padding: 2px; vertical-align: middle; }
      .d2h-lines-deleted { text-align: left; border: 1px solid #e9aeae; border-radius: 0 5px 5px 0; color: #c33; padding: 2px; vertical-align: middle; margin-left: 1px; }
      .d2h-file-name-wrapper { display: flex; align-items: center; width: 100%; font-family: "Source Sans Pro", "Helvetica Neue", Helvetica, Arial, sans-serif; font-size: 15px; }
      .d2h-file-name { white-space: nowrap; text-overflow: ellipsis; overflow-x: hidden; }
      .d2h-file-wrapper { border: none; }
      .d2h-diff-table { width: 100%; border-collapse: collapse; font-family: Menlo, Consolas, monospace; font-size: 13px; }
      .d2h-diff-tbody > tr > td { height: 20px; line-height: 1; }
      .d2h-files-diff { display: block; width: 100%; height: 100%; }
      .d2h-file-diff { overflow-x: scroll; overflow-y: hidden; }
      .d2h-file-side-diff { display: inline-block; overflow-x: scroll; overflow-y: hidden; width: 50%; margin-right: -4px; margin-bottom: -8px; }
      .d2h-code-line { display: inline-block; white-space: nowrap; padding: 0 10px; }
      .d2h-code-side-line { display: inline-block; white-space: nowrap; padding: 0 10px; }
      .d2h-code-wrapper { margin: 0 1px; }

      .d2h-code-line del,
      .d2h-code-side-line del { display: inline-block; margin-top: -1px; text-decoration: none; background-color: #fdb8c0; border-radius: .2em; }

      .d2h-code-line ins,
      .d2h-code-side-line ins { display: inline-block; margin-top: -1px; text-decoration: none; background-color: #acf2bd; border-radius: .2em; text-align: left; }
      .d2h-code-line-prefix { display: none; }
      .d2h-code-line-ctn { display: inline; background: 0 0; padding: 0; word-wrap: normal; white-space: pre; }
      .d2h-code-line-ctn ins { padding: 3px 0; border-radius: 0; }
      .d2h-code-line-ctn del { padding: 3px 0; border-radius: 0; }
      .line-num1 { box-sizing: border-box; float: left; width: 40px; overflow: hidden; text-overflow: ellipsis; padding-left: 3px; }
      .line-num2 { box-sizing: border-box; float: right; width: 40px; overflow: hidden; text-overflow: ellipsis; padding-left: 3px; }
      .d2h-code-linenumber { box-sizing: border-box; width: 86px; padding-left: 2px; padding-right: 2px; background-color: #fff; color: rgba(0, 0, 0, .3); text-align: right; border: solid #eee; border-width: 0 1px 0 1px; cursor: pointer; }
      .d2h-code-side-linenumber { box-sizing: border-box; width: 56px; padding-left: 5px; padding-right: 5px; background-color: #fff; color: rgba(0, 0, 0, .3); text-align: right; border: none; cursor: pointer; overflow: hidden; text-overflow: ellipsis; }

      .d2h-code-side-emptyplaceholder,
      .d2h-emptyplaceholder { background-color: #fafafa; border-color: #e1e1e1; }
      .d2h-del { background-color: #ffeef0; border-color: #e9aeae; }
      .d2h-ins { background-color: #e6ffed; border-color: #b4e2b4; }
      .d2h-info { background-color: #fff; color: #fff; border-color: #d5e4f2; }
      .d2h-file-diff .d2h-del.d2h-change { background-color: #fdf2d0; }
      .d2h-file-diff .d2h-ins.d2h-change { background-color: #ded; }
      .d2h-file-list-wrapper { margin-bottom: 10px; }
      .d2h-file-list-wrapper a { text-decoration: none; color: #3572b0; }
      .d2h-file-list-wrapper a:visited { color: #3572b0; }
      .d2h-file-list-header { text-align: left; }
      .d2h-file-list-title { font-weight: 700; }
      .d2h-file-list-line { display: flex; text-align: left; }
      .d2h-file-list { display: block; list-style: none; padding: 0; margin: 0; }
      .d2h-file-list > li { border-bottom: #ddd solid 1px; padding: 5px 10px; margin: 0; }
      .d2h-file-list > li:last-child { border-bottom: none; }
      .d2h-file-switch { display: none; font-size: 10px; cursor: pointer; }
      .d2h-icon { vertical-align: middle; margin-right: 10px; fill: currentColor; }
      .d2h-deleted { color: #c33; }
      .d2h-added { color: #399839; }
      .d2h-changed { color: #d0b44c; }
      .d2h-moved { color: #3572b0; }
      .d2h-tag { display: flex; font-size: 10px; margin-left: 5px; padding: 0 2px; background-color: #fff; }
      .d2h-deleted-tag { border: #c33 1px solid; }
      .d2h-added-tag { border: #399839 1px solid; }
      .d2h-changed-tag { border: #d0b44c 1px solid; }
      .d2h-moved-tag { border: #3572b0 1px solid; }

      .selecting-left .d2h-code-line,
      .selecting-left .d2h-code-line *,
      .selecting-left .d2h-code-side-line,
      .selecting-left .d2h-code-side-line *,
      .selecting-right td.d2h-code-linenumber,
      .selecting-right td.d2h-code-linenumber *,
      .selecting-right td.d2h-code-side-linenumber,
      .selecting-right td.d2h-code-side-linenumber * { -webkit-touch-callout: none; -webkit-user-select: none; -moz-user-select: none; -ms-user-select: none; user-select: none; }

      .selecting-left .d2h-code-line ::-moz-selection,
      .selecting-left .d2h-code-line::-moz-selection,
      .selecting-left .d2h-code-side-line ::-moz-selection,
      .selecting-left .d2h-code-side-line::-moz-selection,
      .selecting-right td.d2h-code-linenumber::-moz-selection,
      .selecting-right td.d2h-code-side-linenumber ::-moz-selection,
      .selecting-right td.d2h-code-side-linenumber::-moz-selection { background: 0 0; }

      .selecting-left .d2h-code-line ::selection,

      .selecting-left .d2h-code-side-line::selection,
      .selecting-right td.d2h-code-linenumber::selection,
      .selecting-right td.d2h-code-side-linenumber ::selection,
      .selecting-right td.d2h-code-side-linenumber::selection { background: 0 0; }
      /* Common, default styles for the notification box */

      .s-alert-box,
      .s-alert-box * {
          box-sizing: border-box;
      }

      .s-alert-box {
          position: fixed;
          background: rgba(42,45,50,0.85);
          padding: 22px;
          line-height: 1.4;
          z-index: 1000;
          pointer-events: none;
          color: rgba(250,251,255,0.95);
          font-size: 100%;
          font-family: 'Helvetica Neue', 'Segoe UI', Helvetica, Arial, sans-serif;
          max-width: 300px;
          -webkit-transition: top .4s, bottom .4s;
          transition: top .4s, bottom .4s;
      }

      .s-alert-box.s-alert-show {
          pointer-events: auto;
      }

      .s-alert-box a {
          color: inherit;
          opacity: 0.7;
          font-weight: 700;
      }

      .s-alert-box a:hover,
      .s-alert-box a:focus {
          opacity: 1;
      }

      .s-alert-box p {
          margin: 0;
      }

      .s-alert-box.s-alert-show,
      .s-alert-box.s-alert-visible {
          pointer-events: auto;
      }

      .s-alert-close {
          width: 20px;
          height: 20px;
          position: absolute;
          right: 4px;
          top: 4px;
          overflow: hidden;
          text-indent: 100%;
          cursor: pointer;
          -webkit-backface-visibility: hidden;
          backface-visibility: hidden;
      }

      .s-alert-close:hover,
      .s-alert-close:focus {
          outline: none;
      }

      .s-alert-close::before,
      .s-alert-close::after {
          content: '';
          position: absolute;
          width: 3px;
          height: 60%;
          top: 50%;
          left: 50%;
          background: #fff;
      }

      .s-alert-close:hover::before,
      .s-alert-close:hover::after {
          background: #fff;
      }

      .s-alert-close::before {
          -webkit-transform: translate(-50%,-50%) rotate(45deg);
          transform: translate(-50%,-50%) rotate(45deg);
      }

      .s-alert-close::after {
          -webkit-transform: translate(-50%,-50%) rotate(-45deg);
          transform: translate(-50%,-50%) rotate(-45deg);
      }

      /* positions */

      .s-alert-bottom-left {
          top: auto;
          right: auto;
          bottom: 30px;
          left: 30px;
      }
      .s-alert-top-left {
          top: 30px;
          right: auto;
          bottom: auto;
          left: 30px;
      }
      .s-alert-top-right {
          top: 30px;
          right: 30px;
          bottom: auto;
          left: auto;
      }
      .s-alert-bottom-right { /*default*/
          top: auto;
          right: 30px;
          bottom: 30px;
          left: auto;
      }
      .s-alert-bottom {
          width: 100%;
          max-width: 100%;
          bottom: 0;
          left: 0;
          right: 0;
          top: auto;
      }
      .s-alert-top {
          width: 100%;
          max-width: 100%;
          top: 0;
          left: 0;
          right: 0;
          bottom: auto;
      }

      /* conditions */

      .s-alert-info {
          background: rgba(18, 151, 226, .6); /* Elaborateカラーに改変 */
          color: #fff;
      }
      .s-alert-success {
          background: #27AE60;
          color: #fff;
      }
      .s-alert-warning {
          background: #F1C40F;
          color: #fff;
      }
      .s-alert-error {
          background: #E74C3C;
          color: #fff;
      }

      [class^="s-alert-effect-"].s-alert-hide,
      [class*=" s-alert-effect-"].s-alert-hide {
          -webkit-animation-direction: reverse;
          animation-direction: reverse;
      }

      /* height measurement helper */
      .s-alert-box-height {
          visibility: hidden;
          position: fixed;
      }
      /* Jelly */

      .s-alert-effect-jelly a {
          color: #fff;
      }

      .s-alert-effect-jelly a:hover,
      .s-alert-effect-jelly a:focus {
          color: #fff;
      }

      .s-alert-effect-jelly .s-alert-close::before,
      .s-alert-effect-jelly .s-alert-close::after {
          background: #fff;
      }

      .s-alert-effect-jelly .s-alert-close:hover::before,
      .s-alert-effect-jelly .s-alert-close:hover::after {
          background: #fff;
      }

      .s-alert-effect-jelly.s-alert-show {
          -webkit-animation-name: animJelly;
          animation-name: animJelly;
          -webkit-animation-duration: 1s;
          animation-duration: 1s;
          -webkit-animation-timing-function: linear;
          animation-timing-function: linear;
      }

      .s-alert-effect-jelly.s-alert-hide {
          -webkit-animation-name: animFade;
          animation-name: animFade;
          -webkit-animation-duration: 0.3s;
          animation-duration: 0.3s;
      }

      @-webkit-keyframes animFade {
          0% { opacity: 0; }
          100% { opacity: 1; }
      }

      @keyframes animFade {
          0% { opacity: 0; }
          100% { opacity: 1; }
      }
